import React from 'react'
import { BrowserRouter, Route, Router, Switch} from 'react-router-dom';


import Landing from './pages/Landing';


function Routes(){
    return(
        <BrowserRouter>
            <Route path='/' component={Landing} />
        </BrowserRouter>
    );
}

export default Routes;
